define("page/app/common/css/common.pagingbar.css",[],function(){seajs.importStyle("#common-pagingbar>ul>li{margin-left:-1px;float:left;vertical-align:middle}#common-pagingbar>ul>li>a{font-size:14px;color:#999;display:inline-block;border:1px solid #999;width:32px;height:32px;line-height:32px;text-align:center;background-color:transparent;padding:0}#common-pagingbar>ul>li.active>a{background-color:#e15c4d;color:#fff;border:1px solid #e15c4d}#common-pagingbar>ul>li>a:hover{color:#e15c4d;border:1px solid #e15c4d}#common-pagingbar>ul>li.active>a:hover{color:#fff}#common-pagingbar>ul>li.no-hover>a{color:#999;border:1px solid #999;width:auto;padding:0 5px;cursor:default}#common-pagingbar>ul>li>span{display:inline-block;margin:0 10px;height:32px;line-height:26px;text-align:center}.common-paging-bold{font-weight:700}.common-pagingbar-goto{padding:5px;height:32px;color:#999;border:1px solid #999}.common-pagingbar-goto input[type=text]{display:inline-block;border-radius:0;padding:4px;width:30px;height:20px;font-size:12px}.common-pagingbar-goto-ok{margin:-2px 0 0 -4px;padding:0 8px;display:inline-block;border-radius:0;border:0;color:#fff;background-color:#e15c4d;font-size:12px;height:20px}")});